import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import Header from './Header';
import BodyCarousel from './BodyCarousel';
import Footer from './Footer';

class App extends React.Component {
  render() {
    return (
      <div>
        <Switch>
          <Header />
          <BodyCarousel />
          <Footer />
        </Switch>
      </div>
    );
  }
}

export default App;
